import DeleteIcon from '@mui/icons-material/Delete';
import './index.css'

 const ListCom =(props)=>{
     return (
         <div className='list-style'>
             <span>
               <DeleteIcon className='delete'/>
             </span>
             <li style={{textDecoration: "line through"}}>{props.target}</li>
         </div>
     )
 }
 export default ListCom
